function drawChart(){var e=google.visualization.arrayToDataTable([["Task","Hours per Day"],["Success",29],["Failed",10],["Improvement",2]]);new google.visualization.PieChart(document.getElementById("piechart")).draw(e,{colors:["#08a04b","#f31a2b","#878787"],legend:{position:"left",alignment:"center",textStyle:{color:"#E5E4E2",fontSize:18,bold:!0}},backgroundColor:{fill:"#212529"},chartArea:{fill:"#212529",width:"85%",height:"100%"},enableInteractivity:!0,fontName:"NexaLight",pieHole:.7,pieStartAngle:95})}google.charts.load("current",{packages:["corechart"]}),google.charts.setOnLoadCallback(drawChart);